import './movieModal.css';


function MovieModal( { }) {

    const closeModal = () => {
        props.handleModalClose();
    }

  return (
    <div className="movie-modal">

        <div id="my-modal" class="modal">

        <div className="modal-content">
            <span className="close" onClick={ closeModal }>&times;</span>
            <p>{ props.title }</p>
        </div>

        </div>
    </div>
  );
}

export default MovieModal;
